import React from 'react';
import './ResultsScreen.css';

import homeIcon from '../assets/home_icon.png';
import restartIcon from '../assets/restart_icon.png';
import addIcon from '../assets/add_icon.png';

const ResultsScreen = ({ onBackToMenu }) => {
    // Mock Data based on the provided image
    const leaderboardParams = [
        { rank: '1st', name: 'Monster18 (You)', score: 4800, words: 6, isMe: true },
        { rank: '2nd', name: 'CryptoCat', score: 3800, words: 8 },
        { rank: '3rd', name: 'Metil', score: 2700, words: 10 },
        { rank: '4th', name: 'Anhelink', score: 2690, words: 5 },
        { rank: '5th', name: 'Nooxin', score: 2670, words: 7 },
        { rank: '6th', name: 'D1ol', score: 2670, words: 12 },
        { rank: '7th', name: 'Crouton.hl', score: 2530, words: 3 },
        { rank: '8th', name: 'RevengelP', score: 2420, words: 6 },
        { rank: '9th', name: 'Pa3gBa', score: 2210, words: 3 },
        { rank: '10th', name: 'Cryptoholic', score: 2090, words: 2 },
    ];

    return (
        <div className="results-screen fade-in">
            {/* Header Section */}
            <div className="results-header">
                <h1 className="game-over-title">GAME OVER</h1>
                <p className="congrats-text">
                    CONGRATS ! YOU FINISHED 1ST, YOUR KNOWLEDGE OF PIGGY IS SUPREME
                </p>

                {/* Action Icons */}
                <div className="result-actions">
                    <button className="icon-btn" onClick={onBackToMenu}>
                        <img src={homeIcon} alt="Home" />
                    </button>
                    <button className="icon-btn" onClick={() => window.location.reload()}>
                        <img src={restartIcon} alt="Restart" />
                    </button>
                    <button className="icon-btn">
                        <img src={addIcon} alt="Add" />
                    </button>
                </div>
            </div>

            {/* Main Content: Pig - Table - Pig */}
            <div className="results-content">
                {/* Left Mascot */}
                <div className="mascot-container left">
                    <img src={mascot} alt="Mascot" className="mascot-img" />
                </div>

                {/* Leaderboard Table */}
                <div className="leaderboard-container">
                    <div className="table-header">
                        <div className="col rank">Rank</div>
                        <div className="col name">Name</div>
                        <div className="col score">Score</div>
                        <div className="col words">Words Solved</div>
                    </div>

                    <div className="table-body custom-scrollbar">
                        {leaderboardParams.map((player, index) => (
                            <div
                                key={index}
                                className={`table-row ${player.isMe ? 'highlight' : ''}`}
                            >
                                <div className="col rank text-pink">{player.rank}</div>
                                <div className={`col name ${player.isMe ? 'text-pink' : ''}`}>
                                    {player.name}
                                </div>
                                <div className={`col score ${player.isMe ? 'text-pink' : ''}`}>
                                    {player.score}
                                </div>
                                <div className="col words">{player.words}</div>
                            </div>
                        ))}
                    </div>
                </div>

                {/* Right Mascot */}
                <div className="mascot-container right">
                    <img src={mascot} alt="Mascot" className="mascot-img flipped" />
                </div>
            </div>

            {/* Confetti or Stars effect could be added here via CSS or canvas */}
        </div>
    );
};

export default ResultsScreen;
